import React from "react";

function Contact() {
    var visible = false;

    function Update() {
        if (visible === true) {
            visible = false;
            return;
        }
        if (visible === false) {
            visible = true;
            return;
        }
        return;
    }
    return (
        <div className="contact">
            <h1>
                Contact
            </h1>
            <ul onMouseEnter={Update()} hidden={visible}>
                <li>
                    Mail
                </li>
                <li>
                    LinkedIn
                </li>
                <li>
                    Call
                </li>
            </ul>
        </div>
    );
}

export default Contact;
